import React from "react";
import h from "./header.module.css"
import logo from "./../../IMG/ButInProjects.png"

const Header = (props) => {
    return (
        <div className={h.header}>
            <div><img src={logo} alt="ButInProject"/></div>
            {props.login}
        </div>
    )
}

export default Header
